import React from 'react';
import { Container, Row, Col } from "react-bootstrap";

const InvolvedStudents = () => {
  return (
    <div>
      <div className="h1-rectangle">
        <Container><h1>Student Involvement</h1></Container>
      </div>
      {/* TODO: membership squares */}
      {/* TODO: clicking opens descriptions */}
      {/* TODO: 3D animated squares for committees */}
      {/* TODO: add categories for committees with emoji */}
    <Container>
      <h5 style={{textAlign:"left"}}>Membership and Leadership Opportunities</h5>
      <p style={{textAlign:"left"}}>Interested in becoming a... </p>
      <Row>
        <Col>
          <h2>Get Involved as an Student</h2>
          <p>Content goes here</p>
          </Col>
      </Row>
    </Container>
  </div>
  );
};

export default InvolvedStudents;
